import React, { Fragment } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './HomePage';
import PageOne from './PageOne';


function App() {
  return (
    <Router>
              <Fragment>
        <PageOne/>
        </Fragment>
      <Routes>
        <Route path="/" element={<HomePage />} />
      </Routes>
    </Router>
  );
}

export default App;
